FeedPackage.Description:
Allow get current BID and ASK price from Forex Market

--cut--
Lexxmt.Forex.Tick tick = Lexxmt.Forex.Live.Get("EURUSD");
Console.WriteLine("BID {0} ASK {1}", tick.Bid, tick.Ask);
--end--

Enables programmers to access virtually unlimited number of forex brokers’ price feeds and simultaneously execute orders on all connected terminals. With tick delivery delay under 10 - 15ms (Subject to your application processing speed and windows thread quantum length).
using System;
using System.Collections;
using System.Threading;
using Lexxmt.Forex;

namespace Demo 
{
	class Program : IMarketListener
	{
		static void Main(string[] args)
		{
			System.Console.WriteLine("Lexxmt.Forex API Demo");

			var tick = Market.GetApproximateQuote("EURUSD");
			Console.WriteLine("BID {0} ASK {1}", tick.Bid, tick.Ask);

			var app = new Program();
			Market.Connection.Subscribe(app);
			for (; ; )
			{
				if(Market.BoostProcessing(int.MaxValue) != int.MaxValue)
					Thread.Sleep(1);
			}
		}

		#region Implementation of IMarketListener

		/// <summary>
		/// Coroutine: We get new broker!
		/// </summary>
		/// <param name="terminal">Broker terminal object</param>
		/// <returns>Yield object or break</returns>
		IEnumerator IMarketListener.RegisterBroker(Terminal terminal)
		{
			System.Console.WriteLine("Enter broker: {0}", terminal.Name);
			yield break;
		}

		/// <summary>
		/// Coroutine: Broker gone...
		/// </summary>
		/// <param name="terminal">Broker terminal object</param>
		/// <returns>Yield object or break</returns>
		IEnumerator IMarketListener.UnregisterBroker(Terminal terminal)
		{
			System.Console.WriteLine("Part broker: {0}", terminal.Name);
			yield break;
		}

		/// <summary>
		/// Coroutine: Trading bridge is enabled on specific terminal/broker
		/// </summary>
		/// <param name="terminal">Broker terminal object</param>
		/// <returns>Yield object or break</returns>
		IEnumerator IMarketListener.EnableTrading(Terminal terminal)
		{
			System.Console.WriteLine("Enable bridge: {0}", terminal.Name);
			yield break;
		}

		/// <summary>
		/// Coroutine: Trading bridge disabled on specific terminal/broker
		/// </summary>
		/// <param name="terminal">Broker terminal object</param>
		/// <returns>Yield object or break</returns>
		IEnumerator IMarketListener.DisableTrading(Terminal terminal)
		{
			System.Console.WriteLine("Disable bridge: {0}", terminal.Name);
			yield break;
		}

		/// <summary>
		/// Coroutine: We get price update from broker
		/// </summary>
		/// <param name="terminal">Broker terminal object</param>
		/// <param name="symbol">Lexxmt.Forex API symbol</param>
		/// <param name="tick">Tick, that rise this event</param>
		/// <returns>Yield object or break</returns>
		IEnumerator IMarketListener.UpdateSymbol(Terminal terminal, Symbol symbol, Tick tick)
		{
			System.Console.WriteLine("{0}:{1}[{2:F3}/{3}]-{4} {5}/{6} ({7}) == {8}", tick.Timestamp.ToString("dd'.'MM'.'yyyy HH':'mm':'ss.fff"), tick.FarDateTime, tick.Age, tick.IsExpired ? "Expired" : "Valid", tick.Symbol, tick.Bid, tick.Ask, tick.Age, terminal.Name);
			yield break;
		}

		/// <summary>
		/// Coroutine: Internal communications
		/// </summary>
		/// <param name="terminal">Broker terminal object</param>
		/// <param name="header">response header</param>
		/// <param name="packet">response payload</param>
		/// <returns>Yield object or break</returns>
		IEnumerator IMarketListener.DeliverMessage(Terminal terminal, MshpxResponseHeader header, MshpxPacket packet)
		{
			yield break;
		}

		/// <summary>
		/// Expert Advice
		/// </summary>
		/// <param name="advice">Advice information</param>
		/// <returns></returns>
		public IEnumerator Advice(IAdviceInfo advice)
		{
			yield break;
		}

		#endregion

	}
}

